// ignore_for_file: file_names

class UserData {
  String? uid = "12345";
  String? email = "dfgeyge";
  String? photoUrl =
      "data:image/jpeg;base64,";
  String? firstName = "Admin";
  String? lastName = "Admin";
  String? displayName = "Admin";
  String? authStatusMessage;
  String? phone = "55646565";
  bool? isNewUser = false;
  String? jwtToken;

  UserData(
      {this.uid,
      required this.email,
      this.firstName,
      this.lastName,
      this.displayName,
      this.photoUrl,
      this.authStatusMessage,
      this.phone,
      this.isNewUser,
      this.jwtToken}) {
    // notifyListeners();
  }

  void updateData(
      {String? uid,
      String? email,
      String? photoUrl,
      String? firstName,
      String? lastName,
      String? displayName,
      String? authStatusMessage,
      String? phone,
      bool? isNewUser,
      String? jwtToken}) {
    if (uid != null) {
      this.uid = uid;
    }
    if (email != null) {
      this.email = email;
    }
    if (photoUrl != null) {
      this.photoUrl = photoUrl;
    }
    if (firstName != null) {
      this.firstName = firstName;
    }
    if (lastName != null) {
      this.lastName = lastName;
    }
    if (displayName != null) {
      this.displayName = displayName;
    }
    if (authStatusMessage != null) {
      this.authStatusMessage = authStatusMessage;
    }
    if (phone != null) {
      this.phone = phone;
    }
    if (isNewUser != null) {
      this.isNewUser = isNewUser;
    }
    if (jwtToken != null) {
      this.jwtToken = jwtToken;
    }
    // notifyListeners();
  }

  void updateUserUsingObject(UserData user) {
    uid = user.uid;
    email = user.email;
    photoUrl = user.photoUrl;
    firstName = user.firstName;
    lastName = user.lastName;
    displayName = user.displayName;
    authStatusMessage = user.authStatusMessage;
    phone = user.phone;
    jwtToken = user.jwtToken;
    // notifyListeners();
  }
}
